SELECT SUM("part"."p_partkey" + "dim_date"."d_datekey") as agg_0 FROM "customer" LEFT OUTER JOIN "lineorder" ON "customer"."c_custkey" = "lineorder"."lo_custkey" LEFT OUTER JOIN "part" ON "lineorder"."lo_partkey" = "part"."p_partkey" LEFT OUTER JOIN "dim_date" ON "lineorder"."lo_orderdate" = "dim_date"."d_datekey" LEFT OUTER JOIN "supplier" ON "lineorder"."lo_suppkey" = "supplier"."s_suppkey"  WHERE "customer"."c_custkey" >= 38846 AND "part"."p_size" BETWEEN 12 AND 34 AND "dim_date"."d_yearmonth" NOT LIKE '%Sep1992%' AND "dim_date"."d_dayofweek" LIKE '%Fr%iday%' AND ("lineorder"."lo_discount" >= 8 OR "lineorder"."lo_linenumber" != 3 OR "lineorder"."lo_discount" BETWEEN 1 AND 9) AND "lineorder"."lo_shipmode" NOT LIKE '%TRUC%K%'